const Watchlist = () => {
  // eslint-disable-next-line
  return (
    // eslint-disable-next-line
    <div id="watchlist">
      <div id="watchlist-header">Trading Watchlist</div>
      <div id="watchlist-content">
        <ul>
          <li>Stock 1</li>
          <li>Stock 2</li>
          <li>Stock 3</li>
          {/* Add more stocks as needed */}
        </ul>
      </div>
    </div>
  );
};

export default Watchlist;
